import React, { useState } from 'react';
import '../styles/Main.css';
import {Link, NavLink, Outlet} from 'react-router-dom';
import 'boxicons';
import Popup from 'reactjs-popup';


export default function Main() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const [isNotification, setIsnotification] = useState(false)

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
        if(isNotification === true){
            setIsnotification(!isNotification);
        }
    };

    const toggleNotification = () => {
        setIsnotification(!isNotification);
        if (isMenuOpen === true){
            setIsMenuOpen(!isMenuOpen);
        }
    }

    return (
        <div>
                <header className={`header ${isMenuOpen || isNotification ? 'menu-open' : ''}`}>
                    <a href="#" className="logol">
                        <img alt="" src="./assets/img/logo.png" />
                    </a>
                    <a href="#" className="logo"> SuperTontine </a>
                    <form action="" className="search-form">
                        <input type="search" name="" placeholder="search here..." id="searchBox" />
                        <label htmlFor="searchBox" className="fas fa-search"></label>
                    </form>
                    <div className="icons">
                        <Popup trigger={<div onClick={toggleNotification} className="fas fa-share" id="theme-btn"><img alt="notifications" src="./assets/img/notif.png" /></div>}> </Popup>
                        <div className="fas fa-user" id="login-btn" onClick={toggleMenu}><img alt="menu" src="./assets/img/menu.png" /></div>
                        <Link to="/home/profile"><div className="fas fa-bars"s id="menu-btn"><img alt="profile" src="./assets/img/profile.png" /></div></Link>
                    </div>
                    <nav className={`navbar ${isMenuOpen ? 'active' : ''}`}>
                        <NavLink className="a" to="/home">home</NavLink>
                        <Link className="a" to="/home/settings">paramètre</Link>
                        <Link className="a" to="/home/MesTontines">Mes Tontines</Link>
                        <Link className="a" to="/home/transactions">Transactions</Link>
                        <Link className="a" to="/home/tontine">Tontine</Link>

                    </nav>
                    <div className={`notification ${isNotification ? 'activ' : ''}`}>
                        <h2>Notifications</h2>
                    </div>
                </header>

        <div className="corps" >
            <Outlet />
        </div>


        <section className="contact" id="contact">
        <div className="contact-box">
            <h3>SuperTontine</h3>
            <div className="social">
            <a href="#"><i className="bx bxl-facebook"></i></a>
            <a href="#"><i className="bx bxl-instagram-alt"></i></a>
            <a href="#"><i className="bx bxl-twitter"></i></a>
            </div>
        </div>

        <div className="contact-box">
            <li><a href="#home" className="active">Home</a></li>
            <li><a href="#about">About Us</a></li>
            <li><a href="#contact">Contact</a></li>
        </div>

        <div className="contact-box address">
            <h3>Contacts</h3>
            <i className="bx bxs-map"><span> Douala - Cameroun</span></i>
            <i className="bx bxs-envelope"><span>SuperTontine@gmail.com</span></i>
            <i className="bx bxs-phone"><span>+237 6 55 55 55 55 </span></i>
        </div>
        </section>

        <div className="end-text">
        <p>© SuperTontine. All Rights Reserved.</p>
        </div>

        <script src="https://cdnjs.cloudflare.com/ajax/libs/aos/2.3.4/aos.js"></script>
        <script src="https://unpkg.com/swiper/swiper-bundle.min.js"></script>
        <script src="https://unpkg.com/boxicons@2.1.4/dist/boxicons.js"></script>
    </div>
  )
}
